package features.diimport dev.gitlive.firebase.Firebaseimport dev.gitlive.firebase.auth.authimport features.auth.di.authModuleimport features.utils.provideDispatcherimport org.koin.dsl.modulefun featuresModule() = listOf(	authModule,	utilsModule,	serviceModule)private val utilsModule = module {	factory {		provideDispatcher()	}}private val serviceModule = module {	single {		Firebase.auth	}}